import '../styles/App.css';
import React from 'react';
import { createBrowserRouter, RouterProvider, BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// Exam components
import Main from './Main';
import Quiz from './Quiz';
import Result from './Result';
import ResultView from './ResultView';
import { CheckUserExist } from '../helper/helper';
import Test from './Test';
import EditQuestion from './EditQuestion';
import Footer from './Footer';
import Header from './Header';

// Teacher components
import THome from './THome';
import TCreate from './TCreate';
import TLogin from './TLogin';
import TDetails from './TDetails';
import THeader from './THeader';
import Tpagetest from './Tpagetest';
import TUpdate from './TUpdate';
import SideNavbar from './SideNavbar';

// Define react routes
const router = createBrowserRouter([
  {
    path: '/',
    element: <Main />
  },
  {
    path: '/quiz',
    element: <CheckUserExist><Quiz /></CheckUserExist>
  },
  {
    path: '/result',
    element: <CheckUserExist><Result /></CheckUserExist>
  },
  {
    path: '/resultView',
    element: <ResultView />
  },
  {
    path: '/test',
    element: <Test />
  },
  {
    path: '/editQuestion',
    element: <EditQuestion />
  },
  {
    path: '/footer',
    element: <Footer />
  },
  {
    path: '/header',
    element: <Header />
  }
]);

function App() {
  return (
    <Router>
      <RouterProvider router={router}>
        <Routes>
          {/* Exam routes */}
          <Route path="/" element={<ExamRoutes />} />
          {/* Teacher routes */}
          <Route path="/teacher/*" element={<TeacherRoutes />} />
        </Routes>
      </RouterProvider>
    </Router>
  );
}

function ExamRoutes() {
  return (
    <>
      <Header />
      <Routes>
        <Route path="/" element={<Main />} />
        <Route path="/quiz" element={<Quiz />} />
        <Route path="/result" element={<Result />} />
        <Route path="/resultView" element={<ResultView />} />
        <Route path="/test" element={<Test />} />
        <Route path="/editQuestion" element={<EditQuestion />} />
        <Route path="/footer" element={<Footer />} />
      </Routes>
    </>
  );
}

function TeacherRoutes() {
  return (
    <>
      <THeader />
      <SideNavbar />
      <Routes>
        <Route path="/teacher/tHome" element={<THome />} />
        <Route path="/teacher/tCreate" element={<TCreate />} />
        <Route path="/teacher/tLogin" element={<TLogin />} />
        <Route path="/teacher/tDetails" element={<TDetails />} />
        <Route path="/teacher/tpagetest" element={<Tpagetest />} />
        <Route path="/teacher/tUpdate/:id" element={<TUpdate />} />
      </Routes>
    </>
  );
}

export default App;
